import Items from "../components/Items";
import GuestRegister from "../components/GuestRegister";

const Shop = props => {
  return (
    <GuestRegister>
      <Items page={parseFloat(props.query.page) || 1} />
    </GuestRegister>
  );
};

export default Shop;
